import React, { useState } from 'react';
import './Proteins.css';

const initialProducts = [
  { name: 'Whey Protein', price: '$29.99', imageUrl: '' },
  { name: 'Casein Protein', price: '$34.99', imageUrl: '' },
  { name: 'Soy Protein', price: '$24.99', imageUrl: '' },
  { name: 'Pea Protein', price: '$27.99', imageUrl: '' },
  { name: 'Hemp Protein', price: '$31.99', imageUrl: '' },
  { name: 'Egg White Protein', price: '$33.99', imageUrl: '' },
  { name: 'Brown Rice Protein', price: '$25.99', imageUrl: '' },
  { name: 'Beef Protein', price: '$36.99', imageUrl: '' },
  { name: 'Multi-Protein Blend', price: '$38.99', imageUrl: '' },
  { name: 'Isolate Protein', price: '$40.99', imageUrl: '' },
  { name: 'Hydrolyzed Protein', price: '$45.99', imageUrl: '' },
  { name: 'Protein Powder Sample', price: '$9.99', imageUrl: '' }
];

const ProteinsPage = () => {
  const [products, setProducts] = useState(initialProducts);

  const handleImageChange = (index, event) => {
    const file = event.target.files[0];
    const reader = new FileReader();
    
    reader.onloadend = () => {
      const newProducts = [...products];
      newProducts[index].imageUrl = reader.result;
      setProducts(newProducts);
    };

    if (file) {
      reader.readAsDataURL(file);
    }
  };

  return (
    <div className="proteins-page">
      <h1 className="page-title">Proteins</h1>
      <div className="products-grid">
        {products.map((product, index) => (
          <div key={index} className="product-card" style={{ backgroundImage: `url(${product.imageUrl})` }}>
            <input
              type="file"
              accept="image/*"
              onChange={(event) => handleImageChange(index, event)}
              className="image-upload"
            />
            <div className="product-info">
              <h2 className="product-name">{product.name}</h2>
              <p className="product-price">{product.price}</p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ProteinsPage;
